import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { PayPalScriptProvider } from '@paypal/react-paypal-js';

ReactDOM.render(
    <React.StrictMode>
        <PayPalScriptProvider options={{ "client-id": "AeFebceon3ssDDM7_w5Cx7l9uw2H2q3-oskUUQPbw4FTe8ljtuyK4hW4FsYbkTtmZHwNnNTUwY4XILg-" }}>
            <App />
        </PayPalScriptProvider>
    </React.StrictMode>,
    document.getElementById('root')
);
